#tnb-search-suggestions {
  display: none;
  position: fixed;
  z-index: 200;
  font-family: "Source Sans Pro", sans-serif;
  font-size: 15px;
  background-color: #fff;
  color: #000;
  width: 300px;
  top: 49px;
  left: 507px;
  box-shadow: 0 2px 4px 0 rgba(0, 0, 0, 0.16), 0 2px 10px 0 rgba(0, 0, 0, 0.12) !important;
  border: 1px solid #ddd;
  text-align: left;
}
#tnb-search-suggestions .search_item {
  background-color: #fff;
  color: #777;
  text-decoration: none;
  text-align: left;
  display: block;
  padding: 10px 26px;
  width: 100%;
  opacity: 0.95;
  border: none;
  cursor: pointer;
}
#tnb-search-suggestions .search_item:hover {
  color: #000;
  opacity: 1;
}
#tnb-search-suggestions .span_search {
  background-color: #ffecee;
}
#tnb-search-suggestions .search_active {
  background-color: #ffecee !important;
  color: #000 !important;
}
#tnb-search-suggestions .search_active .span_search {
  background-color: #ffccd1;
}
@media (max-width: 954px) {
  #tnb-search-suggestions {
    left: 378px;
  }
}
@media (max-width: 828px) {
  #tnb-search-suggestions {
    left: 10px;
    width: 91%;
  }
}

#tnb-profile-dropdown {
  display: block;
  position: fixed;
  z-index: 99999;
  font-family: "Source Sans Pro", sans-serif;
  font-weight: 600;
  width: 350px;
